/**
 * @export
 * @interface GetTenantOwnerDetailsResponse
 */
export interface GetTenantOwnerDetailsResponse {
    /**
     * Unique identifier for the tenant
     * @type {number}
     */
    TenantID: number;
    /**
     * Name of the tenant
     * @type {string}
     */
    TenantName: string;
    /**
     * Email address of the tenant owner
     * @type {string}
     */
    EmailAddress: string;
    /**
     * User ID of the tenant owner
     * @type {string}
     */
    UserId: string;
    /**
     * Domain associated with the tenant (optional)
     * @type {string | null}
     */
    Domain?: string | null;
    /**
     * Product code associated with the tenant (optional)
     * @type {string | null}
     */
    ProductCode?: string | null;
    /**
     * Product name associated with the tenant (optional)
     * @type {string | null}
     */
    ProductName?: string | null;
    /**
     * Product ID associated with the tenant (optional)
     * @type {string | null}
     */
    productId?: string | null;
    /**
     * Contact person for the tenant (optional)
     * @type {string | null}
     */
    ContactPerson?: string | null;
    /**
     * Authentication type code
     * @type {string}
     */
    AuthenticationTypeCODE: string;
    /**
     * Authentication type name
     * @type {string}
     */
    AuthenticationTypeName: string;
}
